import React,{Component} from 'react';
import {Card,Image,Icon} from 'semantic-ui-react';
import AdminCard from './adminCard'

class showDetails extends Component{

	constructor(props){
		super(props);
	}

	render(){
		return(
			<Card.Group>
				{this.props.shows.map((show,index)=>{
					return(
						<Card key={index}>
							<Image />
							<Card.Content>
								<Card.Header> {show.showName} </Card.Header>
								<Card.Meta> {`Date : ${show.date}`}</Card.Meta>
								<Card.Meta>{`From : ${show.fromTime} To : ${show.toTime}`}</Card.Meta>
								<Card.Meta>Amount : <Icon name='ether'/> {show.amount}</Card.Meta>
							</Card.Content>
							<Card.Content extra>
								<a>
									View
								</a>
							</Card.Content>
						</Card>
					)
				})}
				<AdminCard admin={this.props.admin}/>
			</Card.Group>
		)	
	}
}

export default showDetails;
